import React from "react";
import { useNavigate } from "react-router";

export default function Dashboard() {

    const navigate = useNavigate();

    function createRoute(){
        navigate("/create");
    }

    function lookupRoute() {
        navigate("/lookup");
    }

    return(
        <>
            <h3>Hello! How can we help?</h3>
            <br/>
            <button className="btn btn-primary" onClick={createRoute()}>Create Ticket</button>
            <button className="btn btn-primary" onClick={lookupRoute()}>Ticket Lookup</button>
        </>
    );

}
